"use strict";(self.webpackChunkstatic_site=self.webpackChunkstatic_site||[]).push([[146],{146:e=>{e.exports=JSON.parse('[{"id":"0066902c-dfbc-4094-82d7-817c1e4533e0","slug":"san-mateo-county-pride-center","externalUrl":"https://sanmateopride.org/","tags":["transmasculine","non-binary","transfeminine","healthcare","mental-health","social-services"],"address":"1021 S El Camino Real, San Mateo, CA 94402, USA","phoneNumber":"650-591-0133","country":"US","provinceOrState":"CA","city":"San Mateo","county":"San Mateo County","latLng":[37.5569591,-122.3189073],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/san-mateo-county-pride-center-san-mateo","googleMapsUrl":"https://goo.gl/maps/uj5ogP9y4LboxZYD9","facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"샌 마테오 카운티 프라이드 센터","description":"샌 마테오 카운티 프라이드 센터는 LGBTQ+ 커뮤니티를 위한 협력 모델 조직 및 원스톱 쇼핑몰입니다. 우리는 교육, 훈련, 커뮤니티 이벤트, 동료 지원 그룹, 일일 프로그래밍, 임상 치료, 사례 관리를 포함하여 모든 연령의 LGBTQ+ 커뮤니티 멤버를 지원하기 위한 강인한 프로그램과 서비스를 제공합니다."},{"id":"04f0d550-7d16-415f-ae3f-51740223c48f","slug":"understanding-and-supporting-transsexuality-in-children-and-parents","externalUrl":"https://www.kinderinfo.de/ratgeber/transsexualitaet/","tags":["transmasculine","transfeminine","youth-services","parent-family-resources","education-awareness"],"address":null,"phoneNumber":null,"country":"DE","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"어린이와 부모의 트랜스섹슈얼리티 이해와 지원","description":"이 독일의 기사는 부모나 자녀의 트랜스섹슈얼리티를 다루는 가족들을 위한 종합적인 가이드를 제공합니다. 주요 절차와 리소스에 대한 정보를 제공하고 상황을 이해하고 받아들이는 것부터 관련 치료를 진행하는 것에 대한 지침을 제공합니다."},{"id":"07e16941-b605-4cf5-bab5-bdc882c51a1d","slug":"queerspace","externalUrl":"https://www.queerspace.org.au/","tags":["mental-health","social-services","youth-services","support-groups","parent-family-resources","education-awareness"],"address":"100 Drummond St, Carlton VIC 3053, Australia","phoneNumber":"03 9663 6733","country":"AU","provinceOrState":"VIC","city":"Carlton","county":"City of Melbourne","latLng":[-37.8043894,144.9681606],"email":"enquiries@ds.org.au","socialMedia":{"yelpUrl":null,"googleMapsUrl":null},"title":"Queerspace","description":"Queerspace는 2009년에 LGBTIQ+ 커뮤니티에 의해 제공되어진 LGBTIQ+ 건강과 웰빙 지원 서비스입니다. 이는 관계, 가족, 부모되기, 그리고 젊은이들에 초점을 맞추고 있으며, 빅토리아의 북서부 도시 지역에 걸쳐 공동 위치한 서비스를 제공합니다. 서비스에는 상담, 케이스 관리, 지원, 지원 서비스, 동료 지원, 전문 개발, 교육 및 컨설팅이 포함됩니다."},{"id":"0db36ba9-b329-4a54-8302-d7810866457a","slug":"diyhrtcafe","externalUrl":"https://diyhrt.cafe","tags":["transfeminine","non-binary","transmasculine","healthcare","education-awareness"],"title":"DIYHRT.cafe","description":"자기 고체 호르몬 대체 요법에 관심이 있는 개인들을 위한 지식의 중심지이자 열정적인 온라인 커뮤니티입니다. 그들의 웹사이트는 안전하고 포괄적인 공간을 제공하기 위해 헌신하며, 사람들이 자가 투여 HRT에 대한 정보, 리소스, 지원을 접근할 수 있습니다. 대체 방법을 탐색하고 있거나, 복용량과 투여에 대한 지도를 찾고 있거나, 비슷한 경험을 공유하는 다른 사람들과 연결하고 싶은 경우, DIYHRT.cafe는 귀하의 건강과 웰빙에 대한 정보적 결정을 돕기 위한 귀중한 통찰력, 개인적인 이야기, 전문적인 조언을 제공합니다."},{"id":"0df181cd-6431-4f05-a79f-6ae5c8e3f79b","slug":"stuttgarter-declaration-gender-self-determined","externalUrl":"https://die-erklaerung.de/","tags":["legal","healthcare","mental-health","education-awareness"],"address":null,"phoneNumber":null,"country":"DE","provinceOrState":"BW","city":"Stuttgart","county":null,"latLng":null,"email":null,"socialMedia":null,"title":"슈투트가르트 선언: 성별. 자기. 결정.","description":"슈투트가르트 선언은 트랜스젠더와 인터섹스 사람들에 대한 존중스러운 대우의 중요성을 강조합니다. 그것은 트랜스젠더와 인터섹스 개인을 위한 의료, 심리치료, 상담, 그리고 지원 서비스에서 인권의 중요성을 강조합니다. 의사, 심리치료사, 인권 활동가, 그리고 해당 개인들에 의해 개발되었으며, 그것은 자신의 성별을 결정할 권리와 이러한 자기 결정을 존중해야 하는 의료 치료에 대한 의무를 강조합니다."},{"id":"11cfde25-5434-4fae-b782-c9597ebe52f3","slug":"deifydeify-qtibipoc-collective","externalUrl":"https://linktr.ee/deifycbr","tags":["social-services","support-groups","community-stories","education-awareness"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"facebookUrl":"QTIBIPOC Canberra Facebook Group"},"title":"DEiFYDEiFYQTIBIPOC 콜렉티브가 Ngunnawal, Ngunawal과 Ngambri Country에 거주","description":"이것은 DEiFYQTIBIPOC 커뮤니티를 위한 집단 회의입니다. 그룹은 또한 Queer Masculinities Zine과 그들의 특별한 재생 목록에 대해 논의할 것입니다."},{"id":"1665b1de-c17a-4c22-ace3-d635d35ef2b9","slug":"bundesverband-trans","externalUrl":"https://www.bundesverband-trans.de/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","education-awareness","support-groups"],"address":"Prinzregentenstraße 84, 10717 Berlin, Germany","phoneNumber":"+49 (0) 30 – 23 94 98 96","country":"DE","provinceOrState":"BE","city":"Berlin","latLng":[52.4890033,13.3333558],"email":"info@bv-trans.de","socialMedia":null,"town":"Bezirk Charlottenburg-Wilmersdorf","title":"Bundesverband Trans* e.V.","description":"Bundesverband Trans* e.V.는 독일에서 트랜스섹슈얼, 트랜스젠더, 젠더퀴어, 비이진, 트랜스* 등으로 자신을 규정하는 트랜스* 인사들의 권리를 대변하는 국가협회입니다. 이들은 워크숍을 개최하고 컨설팅을 제공하며 출판물을 발행함으로써 이 커뮤니티를 위한 법적, 정치적, 의료적 개혁을 통해 환경을 개선하기 위해 노력합니다."},{"id":"1873eb7a-2dcb-4346-bf6b-91a97237072f","slug":"nsw-service-for-the-treatment-and-rehabilitation-of-torture-and-trauma-survivors","externalUrl":"https://www.startts.org.au/","tags":["healthcare","mental-health","social-services"],"phoneNumber":"+61 (0)2 9646 6700","country":"AU","provinceOrState":"NSW","city":"Carramar","address":"152/168 The Horsley Dr, Carramar NSW 2163, Australia","latLng":[-33.8801011,150.9654668],"email":"stts-startts@health.nsw.gov.au","socialMedia":{"twitterUrl":"https://twitter.com/starttsNSW","facebookUrl":"https://www.facebook.com/STARTTSNSW","instagramUrl":"https://www.instagram.com/startts_nsw/","linkedinUrl":"https://www.linkedin.com/company/startts/","youtubeUrl":"https://www.youtube.com/user/starttsvideos"},"county":"City of Fairfield","title":"고문 및 트라우마 생존자 치료 및 재활을 위한 NSW 서비스","description":"STARTTS는 문화적으로 적절한 심리치료, 지원, 커뮤니티 개입을 제공하여 고문 및 난민 트라우마로부터 회복하고 호주에서 삶을 재건하는 데 도움을 주는 전문 비영리 기관입니다. 또한 난민 및 망명자 배경의 LGBTQIA+ 개인을 지원합니다."},{"id":"18ba5d3d-c47d-47f8-90a4-2f353a1f13ce","slug":"ftmguideorg","externalUrl":"https://FTMGuide.org","tags":["non-binary","transmasculine","healthcare","clothing"],"title":"FTMGuide.org","description":"여성에서 남성으로 변환하는 개인을 지원하기 위해 헌신하는 종합적인 온라인 플랫폼입니다. 그들의 웹사이트는 신뢰할 수 있는 자원으로서, FTM 여행을 시작하는 사람들을 위한 많은 정보, 지침, 그리고 커뮤니티 연결을 제공합니다. 호르몬 치료 및 수술 옵션에 대한 실질적인 조언부터 정신 건강 지원 및 개인적인 이야기에 이르기까지, FTMGuide.org은 개인들이 자신의 변환을 자신감과 명확성으로 탐색할 수 있도록 필요한 지식과 자원을 갖추는 것을 목표로 합니다."},{"id":"192cec64-3c1a-43eb-bfcf-9dfe3372842c","slug":"black-rainbow","externalUrl":"https://blackrainbow.org.au/","tags":["mental-health","support-groups","community-stories","education-awareness"],"address":"Darwin NT, Australia","phoneNumber":null,"country":"AU","provinceOrState":"NT","city":"Darwin","latLng":[-12.4637333,130.8444446],"email":null,"socialMedia":{"instagram":"https://www.instagram.com/blackrainbowaus/","twitter":"https://twitter.com/BlkRnBow","facebook":"https://www.facebook.com/blackrainbowaus/","linkedin":"https://www.linkedin.com/company/black-rainbow/","youtube":"https://www.youtube.com/c/BlackRainbowAustralia"},"title":"블랙 레인보우","description":"블랙 레인보우는 원주민 및 토레스 해협 섬 주민 LGBQTIA+SB 자원봉사 사회 기업으로, 그들의 커뮤니티 건강과 복지에 초점을 맞추고 있습니다. 이 기업은 재정 지원이 없음에도 불구하고, 기부금, 서비스 이용료, 교육 자료 판매를 통해 서비스를 확장하려고 노력합니다. 그들은 아웃리치 프로젝트를 시작하고, 사회 행사를 지원하며, 커뮤니티 향상 및 건강 영향에 대한 연구를 위한 자금을 모읍니다."},{"id":"19d3bf2d-04ed-46e6-ac5b-b2e3c26a7dd1","slug":"minus-eighteen","externalUrl":"https://www.minus18.org.au/","tags":["youth-services","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Minus18","description":"Minus18은 LGBTQIA+ 청소년의 삶을 개선하는 호주의 자선 단체입니다. 그들은 젊은이들이 속하고, 축하 받으며 친구를 만들 수 있는 공간을 만들어 사회적 고립을 해소합니다. 또한 LGBTQIA+ 교육, 자료, 디지털 캠페인을 제공하며 차별 없는 호주를 만들기 위해 노력합니다. 그들의 목표는 젊은이들이 변화를 주도하는 최전선에 서 있기 위해 필요한 기술과 기회를 갖추는 것입니다."},{"id":"1d1d694e-b73a-4c37-ae8b-288fbc81a489","slug":"us-trans-survey","externalUrl":"https://www.ustranssurvey.org/","tags":["education-awareness","community-stories","non-binary","transmasculine","transfeminine"],"address":null,"phoneNumber":null,"country":"US","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":"ustranssurvey@transequality.org","socialMedia":null,"title":"미국 트랜스 설문 조사","description":"미국 트랜스 설문 조사는 미국에서 가장 큰 트랜스 인구 조사로, 트랜스 인구에 의해 이루어진다. 이 조사는 미국과 미국 영토에서 16세 이상의 트랜스와 비이성자 인구의 삶과 경험을 기록한다. 이 설문 조사와 그 보고서는 사람들의 색상 경험과 주별로 보고서를 포함한 중대한 자료였으며, 트랜스 목소리를 통해 미래를 형성하는데 도움이 되었다."},{"id":"1e8cb769-f49b-4428-86ea-2c4cbec96905","slug":"transfemscienceorg","externalUrl":"https://transfemscience.org","tags":["transfeminine","non-binary","healthcare"],"title":"transfemscience.org","description":"여성화 호르몬 치료(FHT)에 특별히 초점을 맞춘 트랜스젠더와 비이진 커뮤니티를 위한 근거 기반의 연구, 교육, 자원을 제공하는 획기적인 온라인 플랫폼입니다. 그들의 웹사이트는 FHT의 의학적, 생리적, 심리적 측면에 대한 신뢰할 수 있는 최신 정보를 찾는 개인들에게 중요한 허브 역할을 합니다. 동료평가를 받은 연구, 전문가 기사, 실용적인 가이드의 포괄적인 컬렉션을 통해, 그들의 사이트는 개개인이 자신의 전환과 건강에 대한 정보를 알려주고 결정을 내릴 수 있게 돕습니다."},{"id":"1ff064d4-6b1e-44e9-8b83-5e4e14d9f1ce","slug":"nonbinary-ch-a-resource-for-non-binary-individuals","externalUrl":"https://www.nonbinary.ch/","tags":["non-binary","education-awareness"],"address":null,"phoneNumber":null,"country":"CH","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"youtubeUrl":"https://www.youtube.com/channel/","pinterestUrl":"https://www.pinterest.com/nonbinarych/"},"title":"nonbinary.ch - Non-binary 개인을 위한 리소스","description":"Non-binary 성 정체성과 관련한 정보와 리소스를 제공하는 종합적인 스위스 웹사이트입니다. 이는 개인의 성 정체성 탐색을 돕거나 Non-binary 개인과 상호작용하는 사람들에게 기본적인 지식을 쉽게 접근할 수 있게 돕습니다. 또한 사이트는 블로그, 뉴스레터, 그리고 책, 영화, 연구와 같은 관련 외부 리소스에 대한 링크를 호스팅합니다."},{"id":"2db72f6f-a5bc-4784-931d-dbe46b9657c6","slug":"the-pinnacle-foundation","externalUrl":"https://thepinnaclefoundation.org/","tags":["education-awareness","financial-aid-scholarships","youth-services"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"더 핀나클 재단","description":"더 핀나클 재단은 젊은 LGBTQIA+ 호주인들에게 장학금, 멘토링 및 기회를 제공하는 호주의 교육 자선단체입니다. 장학금은 호주의 공립 고등 교육 기관에서 전임 연구를 위해 수여됩니다."},{"id":"2f23a24b-2e9d-4f83-9808-1e69981fba12","slug":"ftm-portal-net","externalUrl":"https://ftm-portal.net","tags":["transmasculine","education-awareness","support-groups"],"address":null,"phoneNumber":null,"country":"DE","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"FTM-Portal.net","description":"FTM-Portal.net은 트랜스맨과 다른 트랜스 마스큘리니티들에 대한 가장 큰 독일어 정보 플랫폼으로, 다양한 생활 상황에 대한 경험과 팁을 제공합니다. 이 자원은 출생 시 여성으로 지정된 사람 중 이 초기 분류를 완전히 또는 부분적으로 식별하지 않는 모든 사람에게 유용합니다. 트랜스맨의 친척이나 다른 관심있는 사람들도 등록할 수 있습니다."},{"id":"2f6aa929-342d-4f12-a6a1-238cec4628ae","slug":"tgns-transgender-network-switzerland","externalUrl":"https://www.tgns.ch/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","education-awareness","youth-services","support-groups","parent-family-resources","partner-resources"],"address":null,"phoneNumber":null,"country":"CH","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"facebookUrl":"https://www.facebook.com/transgenderch","twitterUrl":"https://twitter.com/tgnsch","instagramUrl":"https://www.instagram.com/tgns.ch/"},"title":"TGNS 트랜스젠더 네트워크 스위스","description":"TGNS는 스위스의 트랜스젠더 사람들을 위한 네트워크입니다. 그들은 법적 지원을 제공하고, 건강 관련 개혁을 추진하며, 트랜스젠더 커뮤니티에 정신 건강 자원을 제공합니다. 그들은 transmasculine, transfeminine, 그리고 non-binary로 자신을 규정하는 개인들을 위한 지원적이고 포괄적인 환경을 창출하기 위해 다양한 인식 증진 및 교육 프로그램에 참여합니다. TGNS는 또한 청소년 서비스, 지원 그룹, 그리고 트랜스젠더 개인의 가족과 파트너들을 위한 자원도 제공합니다."},{"id":"3077e7a8-0764-4705-b4fd-95f63cf4f778","slug":"medicijnkosten-medication-costs-information","externalUrl":"https://www.medicijnkosten.nl/","tags":["healthcare","financial-aid-scholarships"],"address":null,"phoneNumber":null,"country":"NL","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Medicijnkosten - 약비 정보","description":"약비에 대한 자세한 정보를 제공하는 정보 제공 플랫폼입니다. 약제의 환급에 대한 데이터를 제공하며, 특정 약품을 구매할 수 없는 개인들을 위한 대체방안을 제공합니다. 의료비 재무 계획에 중요합니다."},{"id":"313b4214-64cb-412e-a12e-06cf3ec67654","slug":"open-doors-youth-service","externalUrl":"https://www.opendoors.net.au/","tags":["mental-health","social-services","youth-services","support-groups","parent-family-resources","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"QLD","city":null,"county":"South East Queensland","latLng":null,"email":null,"socialMedia":{"instagramUrl":"https://www.instagram.com/opendoorsyouthservice/"},"title":"Open Doors Youth Service","description":"남동쪽 퀸즈랜드에서 LGBTIQAP+ 청소년과 그들의 가족을 지원합니다. 정신 건강 상담, 집단 치료 프로그램, 사회적 지원, 필수 식품 및 위생품 제공, 안정적인 직장과 주택 확보, 학교, 직장, 가족과 함께 교육 및 훈련을 실시하는 등의 서비스를 제공합니다."},{"id":"313cd7c6-1051-437c-a1d1-b1297f4c49a8","slug":"stonewall-medical-centre-sexual-health-clinic-brisbane","externalUrl":"https://www.stonewall.com.au/","tags":["healthcare","HIV","STI","sex-workers","transfeminine","transmasculine","non-binary"],"address":"52 Newmarket Rd, Windsor QLD 4030, Australia","phoneNumber":"07 3857 1222","country":"AU","provinceOrState":"QLD","city":"Windsor","county":"Brisbane","latLng":[-27.4378562,153.0279458],"email":null,"socialMedia":null,"title":"스톤월 의료 센터 및 성건강 클리닉 – 브리즈번","description":"스톤월 의료 센터는 1995년부터 브리즈번의 레즈비언, 게이, 양성애자, 트랜스젠더, 이중성, 퀴어/의문형 (LGBTQIA+), 성매매자 및 이성애/거성애 커뮤니티의 일반 건강 및 성 건강을 자랑스럽게 서비스하고 있습니다. 이 클리닉은 HIV PEP & PrEP, STI 테스트, 성매매자 상담, 트랜스젠더 및 성 복합 개인의 의료 관리, 스테로이드 및 이미지 향상 약물 모니터링, 추천 등 다양한 서비스를 제공합니다."},{"id":"3143b616-c478-4c99-9cbd-ed16c89a1c70","slug":"meridian-support","externalUrl":"https://www.meridianact.org.au/","tags":["healthcare","support-groups","education-awareness","community-stories"],"address":"Havelock House, 85 Northbourne Ave, Turner ACT 2612, Australia","phoneNumber":"(02) 6257 2855","country":"AU","provinceOrState":"ACT","city":"Turner","latLng":[-35.2736943,149.1291121],"email":"contact@meridianact.org.au","socialMedia":null,"title":"Meridian","description":"Meridian은 40년 이상 동안 LGBTIQA+ 커뮤니티를 지지하고 지원해 왔으며, HIV 서비스, 웰빙 서비스, 성매매자 아웃리치 프로그램 등 Canberra 지역의 다양한 서비스와 프로그램을 제공하고 있습니다."},{"id":"34974bb4-5b32-4157-8820-250bef7a47a8","slug":"australian-transgender-support-association-of-queensland","externalUrl":"https://www.atsaq.org.au/","tags":["non-binary","support-groups","community-stories","social-services"],"address":"Booval QLD 4304, Australia","phoneNumber":"(07) 3705 7663","country":"AU","provinceOrState":"QLD","city":"Booval","county":"City of Ipswich","latLng":[-27.614358,152.788861],"email":"parker@atsaq.org.au","socialMedia":null,"title":"퀸즈랜드 호주 트랜스젠더 지원 협회","description":"1990년부터 트랜스젠더, 다양한 성별, 그리고 논바이너리 개인을 대표하는 퀸즈랜드의 최고 기관입니다. 그들은 트랜스젠더 커뮤니티를 위해 지원, 옹호, 서비스를 제공하고 사회 행사를 조직합니다."},{"id":"377cdcad-ac8e-491b-96aa-13a91886c07a","slug":"jim-collins-foundation","externalUrl":"https://jimcollinsfoundation.org/","tags":["healthcare","financial-aid-scholarships"],"address":"New York, NY 10150, USA","phoneNumber":null,"country":"US","provinceOrState":"NY","city":"New York","county":"New York County","latLng":[40.7582228,-73.9704871],"email":null,"socialMedia":null,"town":"Manhattan","title":"Jim Collins 재단","description":"Jim Collins 재단(JCF)의 임무는 트랜스젠더 사람들에게 성 정체성을 확인하는 수술에 대한 재정 지원을 제공하는 것입니다. 이 재단은 두 가지 장학금 옵션을 제공합니다. 창립자들의 장학금은 수술 비용의 100%를, Krysallis Anne Hembrough 유산 펀드는 수술 비용의 50%를 지원합니다. 이 재단의 목표는 이와 같은 중요한 수술에 대한 접근성을 제공하는 것이지만, 트랜스젠더 사람들에 대한 일반적인 차별 때문에 이러한 비용을 충족시키는 것은 대개 불가능합니다."},{"id":"397b0b03-c59f-46aa-93aa-14170895e5dd","slug":"transgender-india-transition-guide","externalUrl":"https://transgenderindia.com/","tags":["legal","healthcare","mental-health","education-awareness"],"address":null,"phoneNumber":null,"country":"IN","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":"enquiry@transgenderindia.com","socialMedia":null,"title":"트랜스젠더 인도: 당신의 전환 가이드","description":"트랜스젠더 인도는 인도의 트랜스젠더 커뮤니티를 위한 종합적인 코스, 기사 및 자료를 제공합니다. 그것은 호르몬 대체 치료의 기본부터 법적 권리와 보호, 사회적 전환에 이르기까지 다양한 주제를 포함하고 있으며, 각종 분야의 전문가들이 주도하는 코스가 마련되어 있습니다."},{"id":"3a95da73-255a-41db-a65c-233c1f236c3b","slug":"queermed-deutschland-directory","externalUrl":"https://queermed-deutschland.de/","tags":["healthcare","transmasculine","non-binary","transfeminine"],"address":null,"phoneNumber":null,"country":"DE","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"twitterUrl":"https://twitter.com/queermeddeutschland","instagramUrl":"https://instagram.com/queermeddeutschland","linkedinUrl":"https://linkedin.com/company/queermeddeutschland","facebookUrl":"https://facebook.com/queermeddeutschland"},"title":"퀴어메드 독일 디렉토리","description":"퀴어메드 독일은 독일의 LGBTQIA+ 커뮤니티에서 추천하는 의사, 치료사, 그리고 병원들에 대한 디렉토리입니다. 그 목표는 건강보험 시스템에서의 차별을 막고, 모두에게 존중받고 민감한 의료을 보장하는 것입니다. 커뮤니티 내 다양한 개인들을 위해 다양한 추가 옵션을 익명의 설문조사에 포함시키고 있습니다."},{"id":"3b112584-39e6-4ef6-9e75-a465acdea54c","slug":"northern-territory-aids-and-hepatitis-council-inc","externalUrl":"https://www.ntahc.org.au/","tags":["healthcare","social-services","education-awareness"],"address":"46 Woods St, Darwin City NT 0800, Australia","phoneNumber":"08 8944 7777","country":"AU","provinceOrState":"NT","city":"Darwin City","county":"City of Darwin","latLng":[-12.4602736,130.8432107],"email":"info@ntahc.org.au","socialMedia":{"yelpUrl":null,"googleMapsUrl":"https://www.google.com/maps?q=46+Woods+StreetDARWIN+NT+0800"},"title":"북부지역 에이즈 및 간염 협의회 Inc.","description":"북부 지역의 혈액을 통한 바이러스에 대한 지역사회의 대응으로, 그들의 전파를 제거하려는 목표를 정하고 있습니다. LGBTI 생활 지원, 성매매 종사자 접근 홍보, 건강 증진 및 건강 클리닉 제공 등 다양한 서비스를 제공합니다."},{"id":"3b5a33bd-aba4-4205-9a86-293b172e38ee","slug":"genderdysphoriafyi","externalUrl":"https://genderdysphoria.fyi","tags":["transmasculine","non-binary","transfeminine","mental-health","support-groups","community-stories","education-awareness"],"title":"genderdysphoria.fyi","description":"성별 불안증에 대한 이해, 지지, 지식을 찾는 사람들을 위한 신뢰할 수 있는 온라인 자원입니다. 그들의 웹사이트는 개인이 자신의 여정을 강화할 수 있도록 정보, 자원, 그리고 커뮤니티 연결을 풍부하게 제공합니다. 성별 신원과 전환에 대한 포괄적인 가이드부터 개인 이야기와 전문가 조언에 이르기까지, 그들은 모든 사람을 위한 안전하고 포괄적인 공간을 만들기 위해 노력합니다."},{"id":"3f865b77-21e6-472e-be98-b2cfd999dafb","slug":"unitarian-universalist-association","externalUrl":"https://www.uua.org/","tags":["non-binary","support-groups","education-awareness","spiritual"],"address":"24 Farnsworth St, Boston, MA 02210, USA","phoneNumber":"(617) 742-2100","country":"US","provinceOrState":"MA","city":"Boston","county":"Suffolk County","latLng":[42.35163259999999,-71.04857050000001],"email":"info@uua.org","socialMedia":null,"title":"유니타리언 유니버셜리스트 협회","description":"정의, 사랑, 학습, 희망의 삶을 이끌 수 있도록 지원하는 개방적이고 포용적인 정신적 커뮤니티입니다. 이 커뮤니티는 트랜스젠더 커뮤니티를 포함한 다양성을 존중하고 정의의 행동에 적극적인 참여를 장려합니다. 또한 다양한 사회 문제에 대한 자료, 지원, 옹호를 제공합니다."},{"id":"4332f79d-1323-45ca-9b40-df63af9b7179","slug":"movement-advancement-project","externalUrl":"https://www.lgbtmap.org/","tags":["legal","healthcare","education-awareness"],"address":"1905 15th St #1097, Boulder, CO 80302, USA","email":null,"phoneNumber":"(303) 578-4600","country":"US","provinceOrState":"CO","city":"Boulder","county":"Boulder County","latLng":[40.0178641,-105.2763041],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/lgbtmap/","twitterUrl":"https://twitter.com/lgbtmap","instagramUrl":"https://www.instagram.com/lgbtmap/","youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Movement Advancement Project","description":"Movement Advancement Project (MAP)는 모든 사람이 건강과 행복을 추구하고, 생계를 이어가고, 사랑하는 이들을 돌보며, 지역 사회에서 안전하게 생활하고, 시민 생활에 참여할 수 있는 공정한 기회를 갖도록 하는 데 일조하기 위한 철저한 연구, 통찰력, 그리고 소통을 제공하는 독립적인 비영리 연구소입니다."},{"id":"43609b17-7528-4c60-94b4-e90866144715","slug":"jordan-ross-communication-services","externalUrl":"https://www.jordanrosscommunication.com/","tags":["voice-training"],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":"https://www.instagram.com/jordanrosscommunication/","youtubeUrl":"https://www.youtube.com/channel/UC4o7h219hPYdBcPaFpgh9Yw","tiktokUrl":"https://www.tiktok.com/@jordanrosscommunication","twitchUrl":null,"patreonUrl":null},"title":"Jordan Ross 커뮤니케이션 서비스","description":"Jordan Ross는 트랜스, 퀴어, 성별 비준수 개인들을 대상으로 언어, 목소리, 커뮤니케이션 코칭을 제공합니다. 그는 1대1 코칭, 온라인 코스, 이벤트, 그리고 \'Voice Within Coaching Program\'을 제공합니다. 그의 접근 방식에는 신경 언어 프로그래밍, 최면 요법, 요가 지도, 호흡 코칭이 포함되어 있으며, 이는 커뮤니케이션의 물리적 측면뿐만 아니라 정신적, 감정적, 에너제틱한 측면을 다루고자 합니다."},{"id":"4465cbb7-3513-41ae-8878-7a86ebbe9f6a","slug":"gender-dynamix-online-education-portal","externalUrl":"https://www.genderdynamix.org.za/","tags":["transfeminine","transmasculine","non-binary","legal","healthcare","education-awareness","support-groups","community-stories"],"address":"7, 10 Anson St, Observatory, Cape Town, 7925, South Africa","phoneNumber":"+27 (0)21 447 4797","country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-33.9368811,18.470378],"email":"info@genderdynamix.org.za","socialMedia":null,"town":"Observatory","title":"젠더 다이내믹스 온라인 교육 포털","description":"젠더 다이내믹스는 남아프리카 및 남부 아프리카의 트랜스 및 젠더 다양성 커뮤니티의 인권을 증진, 발전시키고 보호하려는 목표를 가진 아프리카 기반의 비영리 단체입니다. 이 조직은 옹호 활동을 진행하고, 역량 강화를 촉진하며, 커뮤니티에 직접적인 서비스를 제공합니다. 또한 건강관리, 교육 프로그램, 법적 젠더 인식에 관련된 온라인 리소스도 제공합니다."},{"id":"47b17f76-670a-4835-8773-409d98934b91","slug":"sylvia-rivera-law-project","externalUrl":"https://srlp.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","community-stories","education-awareness"],"address":"147 W 24th St #5th, New York, NY 10011, USA","phoneNumber":"212-337-8550","country":"US","provinceOrState":"NY","city":"New York","town":"Manhattan","county":"New York County","latLng":[40.744576,-73.9941166],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/sylvia-rivera-law-project-new-york?osq=sylvia+rivera+law+project","googleMapsUrl":"https://goo.gl/maps/sjGv8qoSZPe3XE2QA","facebookUrl":"https://www.facebook.com/sylviariveralawproject","twitterUrl":"https://www.twitter.com/srlp","instagramUrl":"https://instagram.com/sylviariveralawproject/","youtubeUrl":"https://www.youtube.com/user/SylviaRiveraLP","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"실비아 리베라 법률 프로젝트 (SRLP)","description":"실비아 리베라 법률 프로젝트는 모든 사람들이 소득이나 인종에 상관없이 성별 신원과 표현을 자기 결정할 수 있는 자유를 보장하는 데 노력하며, 이를 통해 괴롭힘, 차별 또는 폭력을 겪지 않도록 합니다. SRLP는 법률 도움을 제공하며, 캠페인을 조직하고, 교육을 실시하며, 수감자 자문위원회를 운영합니다. 커뮤니티 참여는 기부, 봉사, 회원 가입을 통해 촉진됩니다."},{"id":"499aa5dd-d3c0-42f6-a686-853672f3c71e","slug":"erin-in-the-morning","externalUrl":"https://www.erininthemorning.com/","tags":["transfeminine","legal","healthcare","education-awareness"],"email":"null","socialMedia":{"facebook":"facebook.com/erininthemorning","email":"mailto:info@erininthemorning.com"},"title":"아침의 에린","description":"트랜스법률과 생활에 대한 뉴스와 토론. 에린 리드에 의해 · 구독자 38,000명 이상"},{"id":"4a930816-9948-45d7-9513-393087685a01","slug":"trans-health-sa","externalUrl":"https://www.transhealthsa.com/","tags":["healthcare","legal","social-services","support-groups","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"SA","city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"facebookUrl":"https://www.facebook.com/TransHealthSA","googleMapsUrl":null,"yelpUrl":null},"title":"Trans Health SA","description":"Trans Health SA는 남호주주의 트랜스 및 성 다양성을 가진 사람들의 건강 요구를 위한 정보와 지원을 제공하기 위해 존재하는 자원봉사 그룹입니다. 이는 존중받는 실무자들의 목록, 의학 및 법률 정보, 지원 기관, 조직, 출판물, 사회 및 지원 그룹, 그리고 트랜스젠더 커뮤니티에서 만들어진 자료를 제공합니다."},{"id":"4be75e80-8ce1-4f46-90f0-ad307cd1829b","slug":"equaldexcom","externalUrl":"https://EqualDex.com","tags":["transfeminine","non-binary","transmasculine","partner-resources"],"title":"EqualDex.com","description":"글로벌 LGBTQ+ 권리에 대한 포괄적이고 최신의 자료를 제공하려는 혁신적인 온라인 플랫폼입니다. 이 웹사이트는 세계 각국의 법률, 정책, 그리고 LGBTQ+ 권리에 대한 사회 태도를 중앙집중적으로 데이터베이스화하고 있습니다. 평등, 포괄성, 법적 보호에 대한 데이터를 매핑하고 시각화함으로써, EqualDex.com은 여성 활동가들, 연구원들, 그리고 글로벌 규모에서 LGBTQ+ 권리를 이해하고 지지하려는 개인들에게 강력한 도구를 제공합니다. 그들의 대화형 지도를 탐색하고, 국가별 프로필을 둘러보시고, 세계적으로 LGBTQ+ 커뮤니티가 직면하고 있는 최신 발전과 도전에 대해 계속해서 정보를 얻으십시오."},{"id":"539168d5-49aa-492c-bfb0-d0a1d9bba1eb","slug":"gender-affirmative-letter-access-project","externalUrl":"https://thegalap.org/","tags":["healthcare","mental-health"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"성 정체성 확증 사안에 대한 서신 접근 프로젝트","description":"GALAP은 성 정체성을 확인하는 치료를 제공하는 독립 클리니션을 위한 플랫폼입니다. 그들은 치료사 목록, 성 정체성 확인을 위한 서신 작성 가이드 등의 자원을 제공합니다. 참고로, 어떤 서명자의 스킬이나 전문성은 GALAP에 의해 확인되지 않을 수 있음을 유의하시기 바랍니다."},{"id":"581b9bb9-0e33-4887-8bf0-0dda3781202c","slug":"a-gender-agenda","externalUrl":"https://genderrights.org.au/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","partner-resources","community-stories","education-awareness","financial-aid-scholarships"],"address":null,"phoneNumber":"(02) 6162 1924","country":"AU","provinceOrState":null,"city":"Canberra","county":null,"latLng":null,"email":null,"socialMedia":null,"title":"성 별 안건","description":"성 별 안건은 사회성 별, 트랜스 및 성 별 다양한 사람들과 그들의 친구, 가족, 그리고 동맹과 함께 작업합니다. 교육, 옹호, 동료 지원, 전문 네트워크를 통해 AGA는 사람들을 서로 연결하며 집단 경험을 기반으로 발전시킵니다. 그들은 지원 그룹, 교육, 교육 자료를 포함한 커뮤니티를 위한 다수의 행사와 자원을 제공합니다. 그들은 옹호 및 위기 핫라인 서비스를 제공합니다."},{"id":"58738396-e4d7-424a-ba8d-59559e883f06","slug":"strandsfortransorg","externalUrl":"https://strandsfortrans.org","tags":["transfeminine","non-binary","transmasculine","friendly-businesses","makeup"],"title":"strandsfortrans.org","description":"Strands For Trans은 모든 고객, 특히 트랜스 커뮤니티의 고객들을 위한 안전하고 긍정적인 경험을 창출하고 영감을 주려는 미용, 헤어 및 웰니스 산업 및 조직의 글로벌 네트워크입니다."},{"id":"594ba858-974c-4c09-8fd4-f4bb35ca6c5f","slug":"pacific-center-for-human-growth","externalUrl":"https://www.pacificcenter.org/","tags":["mental-health","support-groups","healthcare","youth-services","education-awareness"],"address":"2712 Telegraph Ave, Berkeley, CA 94705, USA","phoneNumber":"510-548-8283","country":"US","provinceOrState":"CA","city":"Berkeley","county":"Alameda County","latLng":[37.8611143,-122.2593404],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/pacific-center-berkeley","googleMapsUrl":"https://goo.gl/maps/dSnoipA7TWiDN72b7","facebookUrl":"https://www.facebook.com/pacific.center","twitterUrl":null,"instagramUrl":"https://www.instagram.com/pacificcenterberkeley/","youtubeUrl":"https://www.youtube.com/user/TheInQueery","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"태평양 인간 성장 센터","description":"1973년에 설립된 태평양 인간 성장 센터는 베이 지역에서 가장 오래된 LGBTQIA+ 센터이며, 전국에서 세 번째로 오래되었고, 알라메다 카운티의 LGBTQIA+ 및 QTBIPOC 사람들과 그들의 가족을 위한 유일한 슬라이딩 스케일 정신 건강 클리닉을 운영하고 있습니다."},{"id":"5ac3fd1a-2d29-4001-b51c-d3b62d81e090","slug":"transgender-victoria","externalUrl":"https://tgv.org.au/","tags":["transmasculine","transfeminine","non-binary","legal","healthcare","mental-health","social-services","support-groups","parent-family-resources","partner-resources","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"VIC","city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"facebookUrl":"https://www.facebook.com/TransGenderVictoria/","twitterUrl":"https://twitter.com/transgendervic","instagramUrl":"https://www.instagram.com/transgendervic/"},"title":"트랜스젠더 빅토리아","description":"TGV는 빅토리아의 주요 트랜스 젠더 및 다양한 젠더 인구를 위한 주체입니다. 우리는 커뮤니티, 그들의 파트너, 가족, 친구, 동맹자들을 위한 정의, 평등, 포괄을 달성하기 위해 노력합니다. 우리는 트랜스젠더 커뮤니티의 사회적, 경제적, 건강, 안녕, 그리고 정신 건강 결과를 목표로하는 다양한 자원, 교육, 대변, 그리고 지원 서비스를 제공합니다."},{"id":"682fba48-f668-4fe6-89a7-05a90193e778","slug":"oakland-lgbtq-community-center","externalUrl":"https://www.oaklandlgbtqcenter.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","education-awareness","financial-aid-scholarships","community-stories","partner-resources"],"address":"3207 Lakeshore Ave, Oakland, CA 94610, USA","phoneNumber":"510-882-2286","country":"US","provinceOrState":"CA","city":"Oakland","county":"Alameda County","latLng":[37.8103802,-122.2459822],"socialMedia":{"yelpUrl":null,"googleMapsUrl":"https://goo.gl/maps/EnhwARKBin25SAmA6","facebookUrl":"https://www.facebook.com/oaklandlgbtqcommunitycenter/?notify_field=blurb&modal=profile_completion&notif_t=page_profile_blurb&notif_id=1499829595947085","twitterUrl":null,"instagramUrl":"https://www.instagram.com/oaklandlgbtqcenter","youtubeUrl":"https://youtu.be/3qxj1a9esuU","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"오클랜드 LGBTQ 커뮤니티 센터","description":"오클랜드 최초의 비영리 501c3, 모든 연령, 모든 포괄적인 LGBTQ 커뮤니티 서비스 센터입니다. 제공되는 서비스에는 지원 그룹, 정신 건강 지원, 주거 지원, 청소년 프로그램, 법률 클리닉, 식량 저장소 등이 포함됩니다. 노인 LGBTQ+ 사람들과 트랜스젠더 커뮤니티 회원들을 위한 특별 프로그램들도 진행됩니다."},{"id":"6b4856a7-8cc7-4935-b5ee-bd6ca0dd9a4c","slug":"plume-transgender-nonbinary-healthcare","externalUrl":"https://getplume.co/","tags":["transmasculine","non-binary","transfeminine","healthcare","support-groups"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"twitter":"https://twitter.com/getplume","instagram":"https://www.instagram.com/getplume/","youtube":"https://www.youtube.com/channel/UC_n1AJ_PeVNSPt14kjmSeTw","linkedin":"https://www.linkedin.com/company/plume-healthcare","tiktok":"https://www.tiktok.com/@get.plume"},"title":"Plume","description":"트랜스와 논바이너리 커뮤니티를 위한 가장 큰 헬스케어 공급자로서, 성 정체성을 확정하는 호르몬 치료와 전환 지원부터 불안 및 우울증 약물까지 다양한 서비스를 제공합니다. 서비스는 커뮤니티의 독특한 헬스케어 필요성에 대해 깊은 이해를 가진 트랜스 주도 팀이 제공하며, 여러분이 편안하게 느낄 수 있고, 인정받고, 돌봄을 받을 수 있도록 목표를 두고 있습니다. 여러분이 진정한 자신을 표현하고 필요한 돌봄을 받을 수 있는 곳입니다."},{"id":"6bf639a8-0301-4061-80c2-7738672b036f","slug":"trans-in-3-steps","externalUrl":"https://johanna4711.github.io/Trans-in-3-Schritten/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","education-awareness","voice-training"],"address":null,"phoneNumber":null,"country":"DE","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":"johanna4711@zohomail.eu","socialMedia":{"githubUrl":"https://github.com/johanna4711/Trans-in-3-Schritten"},"title":"3단계에서 Trans*","description":"개인의 전환 도중 도움이 될 가이드로서의 역할을 하는 프로젝트입니다. 이것은 trans*와 관련된 용어, trans*인지 어떻게 알 수 있는지에 대한 정보, 심리 치료 자료, 의료 절차, 일화적인 커밍아웃 스토리, 이름과 성별 상태 변경에 대한 법적 정보, 그리고 다양한 자원과 서비스로의 링크를 포함하고 있습니다."},{"id":"6f38810d-896c-4493-afe2-b612021122fc","slug":"the-shed-melbourne","externalUrl":"https://www.theshedsupport.org.au/","tags":["transmasculine","mental-health","support-groups","healthcare","social-services"],"address":"412 Lygon St, Brunswick East VIC 3057, Australia","phoneNumber":null,"country":"AU","provinceOrState":"VIC","city":"Brunswick East","county":"City of Merri-bek","latLng":[-37.76497579999999,144.9730678],"email":null,"socialMedia":null,"title":"The Shed Melbourne","description":"멜버른 기반의 트랜스마스큘린 개인을 지원하는 그룹으로, 동료 지원 회의, 체육 클럽, 독서 클럽, 정신 건강 자원, 수술 및 테스토스테론 정보 및 지원, 바인더 프로그램 등 다양한 이벤트와 자원을 제공합니다."},{"id":"7510c3ea-47b1-4a60-bfaf-bb98b6f6b5b2","slug":"mapping-attacks-on-lgbtq-rights-in-u.s.-state-legislatures","externalUrl":"https://www.aclu.org/legislative-attacks-on-lgbtq-rights","tags":["legal"],"address":null,"phoneNumber":null,"country":"US","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"미국 주 의회에서 LGBTQ 권리에 대한 공격 지도화","description":"지난 몇 년 동안 미국 각 주는 LGBTQ 권리를 공격하는 법안을 기록적으로 많이 추진하였으며, 이 중에서도 특히 트랜스젠더 청소년을 대상으로 하였습니다. ACLU(American Civil Liberties Union)는 이러한 공격들을 추적하고 우리의 국가 네트워크 자매회사와 협력하여 전국의 LGBTQ 사람들을 지원하고 있습니다. 매년 더 많은 주들이 LGBTQ 사람들을 보호하기 위한 법안을 통과시키는 동안, 주 의회들은 트랜스젠더 사람들을 대상으로하는 법안을 추진하고, 지역 보호를 제한하며, 종교를 이용한 차별을 허용합니다. ACLU는 전국적으로 이러한 잔인한 공격에 대해 계속해서 목소리를 높일 것입니다."},{"id":"75f35c41-274e-4047-bd13-42f7822a5651","slug":"national-queer-trans-therapists-of-color-network","externalUrl":"https://www.nqttcn.com/","tags":["mental-health","social-services"],"address":"Baltimore, MD 21211, USA","phoneNumber":null,"country":"US","provinceOrState":"MD","city":"Baltimore","latLng":[39.3289463,-76.63838319999999],"email":"info@nqttcn.com","socialMedia":{"facebookUrl":"Facebook-f","twitterUrl":"Twitter","instagramUrl":"Instagram"},"title":"국가 퀴어 및 트랜스 칼라 치료사 네트워크","description":"국가 퀴어 및 트랜스 칼라 치료사 네트워크는 퀴어 및 트랜스 컬러 인구를 위한 정신 건강 변혁에 헌신한 치유 정의 조직입니다. 그들은 사회 정의 운동과 정신 건강 분야의 교차점에서 작업합니다."},{"id":"79fdc5af-520b-45bc-a634-7af3d030db42","slug":"shinesa","externalUrl":"https://shinesa.org.au/","tags":["healthcare","education-awareness","mental-health","social-services","support-groups"],"address":"64C Woodville Rd, Woodville SA 5011, Australia","phoneNumber":"8300 5300","country":"AU","provinceOrState":"SA","city":"Woodville","latLng":[-34.87943560000001,138.536817],"email":"info@shinesa.org.au","socialMedia":null,"county":"Charles Sturt","title":"SHINE SA","description":"남호주에 위치한 건강 단체로, 임상 서비스, 성 건강 상담 및 성 및 생식 건강 및 관계 기술에 관련된 교육과 훈련을 제공합니다. 또한 LGBTIQA+ 커뮤니티에 대한 지원 및 포괄적인 서비스를 제공합니다. 또한, 국제 트랜스젠더 및 성 다양성 커뮤니티의 권리와 인정을 위해 축하하고 옹호하는 데 참여합니다."},{"id":"7a817d4c-02db-4c00-9988-6c2dbf63a7d4","slug":"zoe-belle-gender-collective","externalUrl":"https://zbgc.org.au/","tags":["education-awareness","social-services","support-groups"],"address":"58 Mundy St, Bendigo VIC 3550, Australia","phoneNumber":"0467 569 635","country":"AU","provinceOrState":"VIC","city":"Bendigo","county":"Greater Bendigo","latLng":[-36.7605293,144.2860065],"email":"contact@zbgc.org.au","socialMedia":null,"title":"Zoe Belle Gender Collective","description":"Zoe Belle Gender Collective는 전문 교육, 워크숍 및 LGBTQI+ 커뮤니티를 위한 지원을 제공하는 트랜스와 성별 다양성을 지향하는 주도 단체입니다. 이는 커뮤니티 서비스, 종사자들, 가족들 및 친구들 그리고 트랜스와 성별 다양성을 가진 개인들을 위한 자원과 도움을 제공합니다. 또한 최근에는 Transfemme이라는 cis 남성들이 트랜스 여성에게 폭력을 가하는 것을 방지하는 이니셔티브를 출시했습니다."},{"id":"7fb1e1a6-bd81-4515-9aaa-70aea4580e55","slug":"gender-diversity","externalUrl":"https://genderdiversity.org","tags":["education-awareness","healthcare","youth-services","support-groups","parent-family-resources","social-services","non-binary","transmasculine","transfeminine"],"address":"6523 California Ave SW #144, Seattle, WA 98136","country":"US","provinceOrState":"WA","city":"Seattle","county":"King County","latLng":[47.544046,-122.387452],"phoneNumber":"1-833-3GENDER","email":"info@genderdiversity.org","title":"성별 다양성","description":"성별 다양성은 교육을 제공하고, 인식을 높이며, 더 넓은 인간 경험에 대한 통찰력을 제공함으로써 모든 성별 신분과 표현을 가진 어린이와 성인의 안녕을 개선합니다. 또한, 우리는 학교, 스포츠 팀, 직장, 그리고 헬스케어 제공자에서 트랜스젠더 및 성별 다양성을 가진 개인들에게 지지적이고 차별 없는 환경을 만드는데 도움을 줍니다."},{"id":"83a5458b-864a-4180-a176-b291ffbc7cfb","slug":"nsw-treatment-and-rehabilitation-torture-trauma-survivors","externalUrl":"https://www.startts.org.au/","tags":["healthcare","mental-health","social-services","education-awareness"],"address":"152/168 The Horsley Dr, Carramar NSW 2163, Australia","phoneNumber":"+61 (0)2 9646 6700","country":"AU","provinceOrState":"NSW","city":"Carramar","county":"City of Fairfield","latLng":[-33.8801011,150.9654668],"email":"stts-startts@health.nsw.gov.au","socialMedia":{"googleMapsUrl":null,"linkedinUrl":null,"facebookUrl":null,"youtubeUrl":null},"title":"고문 및 트라우마 생존자 치료 및 재활을 위한 NSW 서비스","description":"STARTTS는 문화적으로 타당한 심리치료, 커뮤니티 개입, 서비스 교육을 제공하여 고문 및 난민 트라우마의 상처에서 사람들이 치유될 수 있도록 돕습니다. 그들의 목표는 다양한 성적 취향, 성별, 몸매를 포함한 난민 및 망명자에게 안전하고 지지적인 환경을 만드는 것입니다."},{"id":"878e809b-12aa-483f-be01-3c51a4d331d6","slug":"national-center-for-transgender-equality","externalUrl":"https://transequality.org","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","partner-resources","education-awareness","financial-aid-scholarships"],"address":"1032 15th St NW #199, Washington, DC 20005, USA","phoneNumber":"(202) 642-4542","country":"US","provinceOrState":"CA","city":"Washington D.C.","county":"District of Columbia","latLng":[38.903438,-77.035037],"email":"ncte@transequality.org","socialMedia":{"blogUrl":"https://transequality.org/blog"},"title":"트랜스젠더 평등을 위한 국립 센터","description":"트랜스젠더 평등을 위한 국립 센터는 트랜스젠더 사람들에 대한 이해와 수용을 높이기 위해 정책과 사회적 태도 변화를 촉구하는 조직입니다. NCTE는 노화, 반폭력, 고용, 가족, 건강 및 HIV, 주거 및 노숙 등 트랜스젠더 커뮤니티에 영향을 미치는 문제에 대한 정보를 제공합니다."},{"id":"87ef5091-eaa3-4740-b07f-11a889ead435","slug":"transgender-law-center","externalUrl":"https://transgenderlawcenter.org/","tags":["transmasculine","transfeminine","legal","healthcare","education-awareness"],"address":"Oakland, CA 94612, USA","phoneNumber":"510-587-9696","country":"US","provinceOrState":"CA","city":"Oakland","county":"Alameda County","latLng":[37.8113159,-122.2682245],"email":"info@transgenderlawcenter.org","socialMedia":null,"title":"Transgender Law Center","description":"Transgender Law Center는 모든 사람들이 자기 결정권을 옹호하는 가장 큰 국가적인 trans-led 조직입니다. 풍부한 자원과 출판물을 유지함으로써, 이 센터는 트랜스젠더 사람들이 마주하는 일반적인 법적 도전과 질문을 통해 개개인을 안내합니다. 또한 TLC는 장기적이며 국가적인 trans-led의 해방 운동을 위해 커뮤니티를 강화합니다."},{"id":"88a19313-994c-4908-a518-c09b531743e9","slug":"deutsche-gesellschaft-fur-transidentitat-und-intersexualitat","externalUrl":"https://dgti.org/","tags":["transmasculine","transfeminine","non-binary","legal","healthcare","education-awareness"],"address":null,"phoneNumber":null,"country":"DE","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/dgti.eV","twitterUrl":"https://twitter.com/dgti_eV","instagramUrl":"https://www.instagram.com/dgti_ev/","youtubeUrl":"https://www.youtube.com/channel/UCvPv3gwmnZcU5JT-06vxJrA"},"title":"Deutsche Gesellschaft für Transidentität und Intersexualität","description":"Deutsche Gesellschaft für Transidentität und Intersexualität (dgti)는 트란스, 인터 젠더, 논 바이너리, 무 성별 사람들이 사회의 모든 계층에서 인정받을 수 있도록 옹호하는 독일 전국의 전문 학회입니다. dgti는 동료 간 상담, 법률 정보, 뉴스를 제공하며, 트란스* 상담사와 의료 전문가를 위한 다양한 자원 프로그램을 가지고 있습니다."},{"id":"8a206480-e41f-4bb6-9128-94d4b04cd997","slug":"the-inner-circle","externalUrl":"https://theinnercircle.org.za/","tags":["education-awareness","support-groups","spiritual"],"address":"Lester Rd, Wynberg, Cape Town, 7824, South Africa","phoneNumber":"+27 (0) 21 761 0037","country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-34.011883,18.469623],"email":"admin@theinnercircle.org.za","socialMedia":{"facebook":"https://www.facebook.com/pg/The-Inner-Circle-151896104833723/","twitter":"https://twitter.com/TIC_SouthAfrica"},"town":"Wynberg","title":"내부 서클","description":"성적 지향과 성별 신원에 근거한 소외된 무슬림들에게 치유를 가져오는 것을 목표로 한 전세계 무슬림 커뮤니티를 통한 영성, 교육, 운동 구축"},{"id":"8ab7bb47-206d-4872-a3ca-e692ce2036ec","slug":"florida-name-change-home","externalUrl":"https://www.floridanamechange.org/","tags":["legal","social-services"],"address":null,"phoneNumber":null,"country":"US","provinceOrState":"FL","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"플로리다 이름 변경 홈","description":"이 웹사이트는 이름이나 성별을 플로리다에서 업데이트하려는 사람들을 위한 단계별 지침을 제공합니다. 이 단계에는 법원에 청원서를 제출하고, 사회보장 카드, 운전 면허증, 여권, 그리고 탄생 증명서를 업데이트하는 것이 포함됩니다."},{"id":"91296a03-5c7f-4105-9ba7-2aa9e8bf5223","slug":"parents-of-gender-diverse-children","externalUrl":"https://www.pgdc.org.au/","tags":["parent-family-resources","support-groups","education-awareness","mental-health","youth-services"],"address":null,"phoneNumber":"03 9663 6733","country":"AU","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":"info@pgdc.org.au","socialMedia":{},"title":"성 다양성을 가진 아이들의 부모님들","description":"성 다양성을 가진 아이들의 부모님들은 호주에서 성 전환과 성 다양성을 가진 아이들을 키우는 부모님들과 그런 아이들에게 지원, 연결, 자원을 제공합니다. 이 조직은 비밀 보장 및 비판의 여지 없는 동료 지원, 월별 모임, 온라인 부모 허브, 전문적인 개발과 스피커를 제공합니다."},{"id":"92920c87-b8c4-4179-a98b-7c9b036c8b1a","slug":"amsterdam-umc-kennis-en-zorgcentrum-genderdysforie","externalUrl":"https://www.amc.nl/web/specialismen/genderdysforie.htm","tags":["healthcare","education-awareness"],"address":"De Boelelaan 1117, 1081 HV Amsterdam, Netherlands","phoneNumber":"+31(0)20 444 0542","country":"NL","provinceOrState":"NH","city":"Amsterdam","county":"Amsterdam","latLng":[52.3346104,4.8598083],"email":"genderteam-poli@vumc.nl","socialMedia":{"instagramUrl":"https://www.instagram.com/genderteam_amsterdamumc"},"town":"Amsterdam-Zuid","title":"암스테르담 UMC - 지더 디스포리아 지식 및 치료센터","description":"암스테르담 UMC의 지더 디스포리아 지식 및 치료센터는 태어난 성별이 자신의 정체성과 일치하지 않는다고 느끼는 사람들에게 의료 치료와 심리적 지원을 제공하는 데 전문화되어 있습니다. 이 센터는 개인의 다양성을 받아들이고, 개인의 필요에 맞춘 서비스를 제공하며, 성별 불일치 치료에 대한 전문지식으로 국제적으로 인정받고 있습니다. 또한 트랜스젠더 개인의 이해와 치료를 향상시키기 위한 연구를 수행하고, 신규 의료 전문가에게 교육을 제공합니다."},{"id":"9e09fcfd-eb5b-4dd9-825c-ae3c3c5ce940","slug":"trans-lifeline-peer-support-and-resources","externalUrl":"https://translifeline.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","support-groups","education-awareness","financial-aid-scholarships"],"address":null,"email":null,"phoneNumber":"(877) 565-8860","socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/TransLifeline/","twitterUrl":"https://twitter.com/TransLifeline","instagramUrl":"https://www.instagram.com/translifeline/?hl=en","youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Trans Lifeline","description":"Trans Lifeline은 트랜스 제도를 주도하며 트랜스성 커뮤니티를 위한 동료 지원 및 자원을 제공하는 조직입니다. 커뮤니티 지원, 마이크로 그랜트, 핫라인에 초점을 맞추고 있으며, 이들은 트랜스 성 인사들이 번영할 수 있도록 그들이 필요로 하는 연결고리와 자원을 제공하려고 합니다. Trans Lifeline은 또한 #SafeHotlines와 같은 이니셔티브를 통해 트랜스 커뮤니티를 옹호합니다."},{"id":"a0bc83c3-3566-4529-9560-bf98eb404461","slug":"transliving-international","externalUrl":"https://transliving.co.uk/main/","tags":["support-groups","community-stories","education-awareness","clothing"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Transliving International","description":"Transliving International은 온라인 매거진, 클럽 밤, 이벤트, 쇼핑 플랫폼을 제공하는 트랜스젠더 커뮤니티를 위한 글로벌 지원 그룹입니다. 이는 도움, 조언, 개인적인 이야기, 기능을 제공함으로써 모든 성 다양성 및 트랜스 인들의 목소리를 확대시킵니다."},{"id":"a453684e-c325-457f-8841-05c0adabbbc0","slug":"the-trevor-project","externalUrl":"https://www.thetrevorproject.org/","tags":["youth-services","support-groups","mental-health","education-awareness"],"address":"West Hollywood, CA 90069, USA","email":null,"phoneNumber":"(212) 695-8650","country":"US","provinceOrState":"CA","city":"West Hollywood","county":"Los Angeles County","latLng":[34.0931603,-118.3783347],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/TheTrevorProject","twitterUrl":"https://twitter.com/trevorproject","instagramUrl":"https://www.instagram.com/trevorproject/","youtubeUrl":"https://www.youtube.com/thetrevorproject","tiktokUrl":"https://www.tiktok.com/@trevorproject","twitchUrl":null,"patreonUrl":null},"title":"The Trevor Project","description":"The Trevor Project는 LGBTQ+ 청소년을 대상으로 자살 예방 서비스를 제공하는 미국 비영리 단체입니다. 이 사이트는 위기 대응 및 자살 예방 핫라인, TrevorChat, TrevorText 및 정신 건강, 사회 서비스, 지원 그룹에 대한 지침을 포함하여 트랜스젠더 커뮤니티에 가치있는 자료를 제공합니다."},{"id":"a4f258ec-17b7-4477-bd90-a7580ab66086","slug":"gender-dysphoria-1177-vaardguiden","externalUrl":"https://www.1177.se/liv--halsa/konsidentitet-och-sexuell-laggning/konsdysfori/","tags":["healthcare"],"address":null,"phoneNumber":null,"country":"SE","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"성별 불일치 - 1177 Vårdguiden","description":"스웨덴 1177 건강 지침에서 제공하는 성별 불일치에 대한 종합적인 자료로, 이것이 무엇인지, 어떤 느낌인지, 도움을 어떻게 찾을 수 있는지 및 다양한 치료 옵션에 대해 논의합니다. 이는 성별 불일치를 경험하고 있는 사람들에게 상세한 정보를 제공하고 그들의 여정을 지원함으로써 역할을 합니다."},{"id":"a58acbca-7d7d-4c6d-8d5f-f1a281e0f8b9","slug":"pronoun-dressing-room","externalUrl":"http://www.pronouns.failedslacker.com/","tags":["non-binary","transmasculine","transfeminine","education-awareness"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"대명사 탈의실","description":"대명사 탈의실은 개인이 다양한 세트의 대명사를 시험하고 탐색할 수 있는 온라인 공간을 제공합니다. 이 웹사이트는 트랜스젠더 커뮤니티가 대명사 선택에서 더 쉽게 결정을 내릴 수 있도록 돕고, 그들이 다른 맥락에서 어떻게 다양한 대명사가 보일지 보게 합니다."},{"id":"ab058b91-49cf-4733-b3a3-47ea59b31a78","slug":"a-place-for-marsha","externalUrl":"https://www.aplaceformarshaofficial.org/","tags":["transmasculine","non-binary","transfeminine","legal","mental-health","social-services","support-groups","education-awareness","financial-aid-scholarships","community-stories"],"email":"info@aplaceformarshaofficial.org","socialMedia":{"tiktok":"https://www.tiktok.com/@aplaceformarsha"},"title":"A Place for Marsha","description":"A Place for Marsha는 점점 위험해지는 주에서 트랜스 개인과 가족들을 보다 안전한 장소로 돕는 많은 스타트업 프로젝트 중 하나입니다. APFM은 전국적으로 트랜스에 대한 반대 입법이 증가하는 반응으로 2023년 3월에 그 여정을 시작했습니다. APFM은 이제 빨간 주에서의 난민을 룸메이트로 매칭하는 데 집중하며, 한 가구를 신중하게 처리합니다."},{"id":"af3483e3-d7f7-49d7-a4e9-b70e566bee98","slug":"good-hope-metropolitan-community-church","externalUrl":"https://www.goodhopemcc.org","tags":["spiritual"],"address":"18 Belmont Rd, Rondebosch, Cape Town, 7700, South Africa","phoneNumber":null,"country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-33.9605258,18.474311],"email":"secretary@goodhopemcc.org","socialMedia":{"facebook":"https://www.facebook.com/goodhopemcc"},"town":"Rondebosch","title":"GOOD HOPE Metropolitan Community Church","description":"예수 그리스도의 원칙에 기반을 두고 다양성을 축하하며 모든 사람이 환영 받는 안전하고 비판적이지 않은 공간을 제공하는 신학적으로 진보적이고 포괄적인 크리스천 커뮤니티입니다. 이는 남아프리카 공화국 케이프 타운에 기반을 둔 포괄적인 기독교 회중의 일부이며, Metropolitan Community Churches (MCC)라고 알려진 더 큰 국제 종파의 일부입니다."},{"id":"b2741990-69b4-4fbd-98e7-933b8932425f","slug":"transfamily","externalUrl":"https://www.transfamily.org.au/","tags":["support-groups","parent-family-resources","community-stories","education-awareness"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"facebookUrl":"https://www.facebook.com/Transfamily-Australia-126186690851106/"},"title":"Transfamily","description":"트랜스와 성 다양성을 가진 사람들의 부모, 형제, 확장된 가족, 친구들을 위한 동료 지원 그룹입니다. 자원, 이벤트, 커뮤니티 이야기를 위한 플랫폼을 제공합니다. 또한 트랜스젠더 커뮤니티에 대한 유용한 정보와 통찰력을 제공하는 Transfamily 책도 제공합니다."},{"id":"b6955ff7-83b4-464f-8be8-72a50dc6a878","slug":"transvoicelessons","externalUrl":"https://www.transvoicelessons.com/","tags":["voice-training"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":"https://www.youtube.com/c/transvoicelessons","tiktokUrl":null,"twitchUrl":null,"patreonUrl":"https://www.patreon.com/transvoicelessons/posts"},"title":"TransVoiceLessons","description":"TransVoiceLessons는 보다 남성적이거나, 여성적이거나, 또는 중성적인 소리를 내기를 원하는 트랜스젠더 및 비이진성 개인들을 대상으로 품질 높은 목소리 제어 및 해방 서비스를 제공합니다."},{"id":"b86b3697-6f65-4fd1-8506-e2ce879a614c","slug":"working-it-out-tasmania","externalUrl":"https://www.workingitout.org.au/","tags":["non-binary","transmasculine","transfeminine","mental-health","social-services","youth-services","support-groups","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"TAS","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"워킹 잇 아웃","description":"워킹 잇 아웃은 타스마니아의 성별, 성, 및 성간 성 지원 및 교육 서비스입니다. 이 서비스는 LGBTIQ+ 타스마니아 사람들에게 지원과 옹호 서비스를 제공하고, 학교, 직장, 정부 및 비정부 조직에 교육 및 훈련 프로그램을 제공합니다."},{"id":"b933717d-90e3-4aff-a61f-bd1fd1f2893b","slug":"thorne-harbour-health","externalUrl":"https://thorneharbour.org/","tags":["healthcare","support-groups","mental-health","social-services","education-awareness"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Thorne Harbour Health","description":"성, 성별 및 성적 다양성 커뮤니티를 위한 건강 및 웰빙 서비스를 제공하는 LGBTIQ+ 공동체 관리 조직으로, HIV 지원 및 예방, 상담, 가정 폭력 서비스를 포함합니다."},{"id":"ba3e158a-53b6-4dc5-a220-4a065859aa7f","slug":"queer-lexikon","externalUrl":"https://queer-lexikon.net/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","support-groups","education-awareness","community-stories"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"twitterUrl":"fab fa-twitter","facebookUrl":"fab fa-facebook","instagramUrl":"fab fa-instagram","youtubeUrl":"fab fa-youtube","patreonUrl":"fab fa-patreon","tumblrUrl":"fab fa-tumblr","linkedinUrl":"fab fa-linkedin-in","emailUrl":"fas fa-envelope"},"title":"Queer Lexikon","description":"Queer Lexikon은 성적, 연애, 성 다양성부터 정신 건강과 지원 그룹에 이르기까지 다양한 주제를 다루며 퀴어 커뮤니티에 대한 광범위한 정보와 지원을 제공하는 온라인 자원입니다. 교육, 인식, 커뮤니티 이야기의 중심지입니다."},{"id":"bc49f848-fa04-47ff-af81-cb500214ce61","slug":"transformering-se","externalUrl":"https://transformering.se/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","partner-resources","community-stories","education-awareness"],"address":"Stockholm, Sweden","phoneNumber":null,"country":"SE","provinceOrState":"Stockholm County","city":"Stockholm","latLng":[59.32932349999999,18.0685808],"email":null,"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"twitterUrl":"https://twitter.com/rfslungdom","instagramUrl":"https://www.instagram.com/rfsl_official","facebookUrl":"http://www.facebook.com/transformering"},"title":"Transformering.se","description":"RFSL Ungdom 및 RFSL이 운영하는 스웨덴 리소스 허브로서, 트랜스젠더 및 성 정체성 문제에 관련된 지원 및 정보를 제공합니다. 내용에는 권리, 관계, 성 확증 치료가 어떻게 작동하는지 등이 포함되어 있습니다. 이것은 트랜스젠더인 개인, 개인적인 트랜스 경험이 있거나 성 정체성 / 표현에 의문을 가진 사람들, 그리고 그들을 지원하는 가족, 전문가 또는 자원 봉사자를 위해 설계되었습니다."},{"id":"be017772-af87-4920-ae62-1a3e961d216a","slug":"transamsterdam","externalUrl":"https://www.transamsterdam.nl/","tags":["artists-creators","education-awareness"],"address":"Linnaeusstraat 89, 1093 EK Amsterdam, Netherlands","phoneNumber":null,"country":"NL","provinceOrState":"NH","city":"Amsterdam","county":"Amsterdam","latLng":[52.35914529999999,4.9263607],"email":"info@transamsterdam.nl","socialMedia":{"linktr":"linktr.ee/transamsterdam"},"town":"Amsterdam-Oost","title":"TransAmsterdam","description":"TransAmsterdam은 암스테르담의 예술, 문화, 라이프스타일에 초점을 맞춘 트랜스 조직입니다. 이 조직은 다양한 기둥을 통해 트랜스젠더 커뮤니티를 지원합니다. 이러한 기둥에는 Trans & Friends 카페, InClusion 및 기타 이벤트를 통해 만날 기회를 만드는 것이 포함됩니다. 또한, Trans Art School에서의 워크숍, 테마 모임, 극장 제작을 통해 재능 개발을 촉진합니다. 마지막으로, 트랜스젠더, 비이진 아티스트 및 퍼포머들에 의한 및 그들을 위한 예술과 문화 플랫폼을 제공합니다."},{"id":"be5fc820-136d-4e7f-a3b5-ae6d103ef1ad","slug":"gender-centre","externalUrl":"https://gendercentre.org.au/","tags":["transmasculine","transfeminine","non-binary","mental-health","social-services","support-groups","education-awareness","healthcare"],"address":null,"phoneNumber":"02 9519 7599","country":"AU","provinceOrState":null,"city":"Sydney","county":null,"latLng":null,"email":null,"socialMedia":null,"title":"The Gender Centre Inc.","description":"The Gender Centre Inc.는 성 정체성 탐색 및 성 역겹음증 완화를 돕는 다양한 전문 서비스를 제공합니다. 그것은 사람들이 진심으로 스스로를 인지하고 살아갈 수 있도록 여정의 모든 단계에서 트랜스와 성 표현 인물들을 지원합니다. 숙박 시설, 사례 관리, 교육 및 훈련, 상담 및 정신 건강 서비스, 그룹, 뉴스, 자료 등을 제공합니다."},{"id":"bfc56737-9f48-4344-8a0e-22ae450d5250","slug":"learning-with-love-the-2023-pflag-national-convention","externalUrl":"https://pflag.org/","tags":["education-awareness","support-groups","parent-family-resources","community-stories"],"address":"Washington, DC, USA","phoneNumber":null,"country":"US","provinceOrState":"DC","city":"Washington","county":"District of Columbia","latLng":[38.9071923,-77.0368707],"email":null,"socialMedia":null,"title":"사랑으로 배우기: 2023 PFLAG 전국 콘벤션","description":"PFLAG가 연결, 네트워킹, 학습 및 경험 공유를 위해 개최하는 4일간의 이벤트입니다. 콘벤션은 LGBTQ+ 사람들과 그들을 사랑하는 이들을 위한 사랑하는, 공정하며 긍정적인 세상을 만드는 데 이바지하기 위한 워크숍, 패널, 프리젠테이션을 개최할 것입니다."},{"id":"c23736ad-03dc-41dd-b8f9-4f64b2727cdc","slug":"freedom-centre-wa","externalUrl":"https://www.freedom.org.au/","tags":["youth-services","mental-health","social-services","support-groups","education-awareness","parent-family-resources"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"WA","city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"facebookUrl":"https://www.facebook.com/FreedomCentrePerth","instagramUrl":"https://www.instagram.com/freedom_centre/"},"title":"Freedom Centre","description":"Freedom Centre는 WA 주의 LGBTIQA+ 청소년을 위한 다양한 지원 서비스를 제공합니다. 이에는 드롭인 세션, 커뮤니티 개발, 상담 등이 포함되며, 모든 LGBTIQA+ 청소년이 포괄되고 연결되며 존중받는 데 기여하고 있습니다. 또한 부모, 전문가, 커뮤니티 및 조직에 대한 교육과 지침도 제공하고 있습니다."},{"id":"c4437a30-c2e0-4672-8f37-74de08818f97","slug":"point-of-pride","externalUrl":"https://www.pointofpride.org/","tags":["transmasculine","transfeminine","non-binary","healthcare","financial-aid-scholarships"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"자부심의 중심지","description":"Point of Pride는 건강과 웰니스 치료를 필요로 하는 트랜스 인물들에게 재정 지원과 직접 지원을 제공합니다. 이러한 지원 프로그램은 연간 트랜스젠더 수술 자금, HRT 접근 자금, 전기 분해 지원 및 가슴 바인더 및 페미닌 쉐이프웨어를 감당하거나 안전하게 찾을 수 없는 트랜스 인물들에게 무료로 제공이 이루어집니다."},{"id":"c6a77c4c-7aa3-47b3-b385-8573e1ba3a78","slug":"transmann-ev","externalUrl":"https://transmann.de/","tags":["transmasculine","non-binary","healthcare","mental-health","support-groups","education-awareness"],"email":"info@transmann.de","socialMedia":{},"title":"TransMann e.V.","description":"TransMann e.V.는 독일 전역의 모든 여성에서 남성(FzM/FtM) 트랜스* 및 인터* 인들을 위한 광범위한 지원을 제공하는 자원봉사, 비영리 기구입니다. 서비스는 그룹 모임, 온라인 정보 및 자료, 나와 같은 상황(파이어 투 파이어) 상담, 교육 자료 및 공개 행사를 포함합니다. 또한 트랜스*에 대한 경험을 가진 의사 및 치료사의 전국 데이터베이스를 유지합니다. 주요 대상이 FzM-트랜스* 및 인터* 사람들이지만 가족, 친구, 파트너, 교육 기관, 고용주에게도 자원과 지원을 확대합니다."},{"id":"cd48f2d0-8241-4fa5-a0aa-dc3cd3d386e8","slug":"rainbowrailroadorg","externalUrl":"https://RainbowRailroad.org","tags":["transfeminine","non-binary","transmasculine","legal","social-services"],"title":"RainbowRailroad.org","description":"전 세계적으로 박해와 폭력에 직면한 LGBTQ+ 개인을 돕고 옹호하기 위해 헌신적인 온라인 플랫폼입니다. 흔들림 없는 헌신으로, 이 웹사이트는 즉각적인 위험에 처한 사람들을 생명을 구하는 자원, 긴급 지원, 그리고 안전한 피난처로 연결합니다. 현지 조직과 동정적 지지자 네트워크와의 파트너십을 통해 RainbowRailroad.org는 피난을 치르고 안식처를 찾는 개인에게 옹호, 법적 지원, 그리고 이주 지원을 지속해서 제공합니다. 인권을 옹호하고, 생명을 구하고, 보다 포괄적인 세상을 위해 노력함으로써 RainbowRailroad.org는 안전을 찾고 자유를 추구하는 LGBTQ+ 개인에게 희망과 보호의 등대 역할을 합니다."},{"id":"cfb4d1a4-0142-4dfa-b152-8e577885e98c","slug":"blaq-aboriginal-corporation","externalUrl":"https://blaq.org.au/","tags":["community-stories","education-awareness","social-services","support-groups"],"address":"Redfern NSW 2016, Australia","phoneNumber":null,"country":"AU","provinceOrState":"NSW","city":"Redfern","county":"City of Sydney","latLng":[-33.892215,151.205873],"email":"admin@blaq.org.au","socialMedia":null,"title":"블랙 어보리지널 기업","description":"BlaQ 어보리지널 기업은 혁신, 포괄성, 이해력 및 옹호를 통해 원주민과 토레스 해협 섬 주민 LGBTQ+SB 커뮤니티를 지원하고 강화하는 데 헌신하는 커뮤니티 조직입니다."},{"id":"d21dfad9-22c7-4a42-9658-d1c573100c33","slug":"baby-making-for-everybody","externalUrl":"https://www.babymakingforeverybody.com/","tags":["parent-family-resources","education-awareness"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"모든 사람을 위한 아기 만들기","description":"LGBTQ+ 및 솔로 부모를 위한 전통적인 이성애 핵가족 모델 외의 다양한 가족 창조 방법에 대한 안내서와 축하입니다. 이 책은 개인적인 이야기와 함께 단계별 안내서를 제공하여 잠재적인 부모들에게 가족을 키울 수 있는 청사진을 제공합니다."},{"id":"d59c0a9f-14ff-4c55-94d6-82313925be14","slug":"the-mckenzie-project","externalUrl":"https://www.themckenzieproject.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","education-awareness"],"address":"8390 W Flagler St STE 201, Miami, FL 33144, USA","email":"Info@TheMcKenzieProject.org","phoneNumber":"305-846-3186","country":"US","provinceOrState":"FL","city":"Miami","county":"Miami-Dade County","latLng":[25.769445,-80.3321284],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"맥켄지 프로젝트","description":"성별 공정을 촉진하고 트랜스젠더 커뮤니티에 서비스를 제공하는 것을 목표로 한 서비스, 프로그램, 이벤트를 제공하는 종합 자원입니다. 건강관리, 법률 지원, 정신 건강 서비스 등을 포함한 지원 서비스와 자원이 포함되어 있습니다."},{"id":"d7378cc4-7726-4de1-8427-8203cb9b61ad","slug":"east-bay-trans-queer-counseling","externalUrl":"https://www.eastbaytranscounseling.org/","tags":["transmasculine","non-binary","transfeminine","mental-health","social-services","youth-services","education-awareness"],"email":"eastbaytranscounseling@gmail.com","address":"3099 Telegraph Ave, Berkeley, CA 94705, USA","phoneNumber":"781-775-7802","country":"US","provinceOrState":"CA","city":"Berkeley","county":"Alameda County","latLng":[37.8538725,-122.2596505],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"East Bay Trans & Queer 상담","description":"East Bay Trans & Queer 상담은 주요 위치인 버클리, CA에서 개별 치료, 성별 탐색 및 전환을 통한 지원, 호르몬과 수술을 위한 추천 편지, 정신 건강 제공자, 학생, 고용주를 위한 전문 교육을 포함하는 슬라이딩 스케일 서비스를 제공합니다. Sam Davis는 트랜스, 퀴어, 성별 제한적이고 성별을 비준수하는 청소년과 성인을 전문적으로 대하는 transgender, genderqueer Licensed Clinical Social Worker (LCSW)입니다. 그들은 동료 지원 그룹의 주관, LGBTQI 회의에서의 커뮤니티 교육, Alameda 카운티에서 심각한 사람들을 위한 9년 동안의 임상실습 및 위기 상담을 포함하여 East Bay에서 정신 건강 제공자로서 16년의 경험을 갖고 있습니다. 그들은 주변에 있는 사람들을 대신하여 조직하는 데 오랫동안 역사를 가진 강력하고 헌신적인 옹호자입니다."},{"id":"dcb18ebe-596d-4d3e-a409-542f06a109a7","slug":"seahorse-victoria-club","externalUrl":"https://seahorsevic.com.au/","tags":["support-groups","community-stories","friendly-businesses"],"address":"St Kilda VIC 3182, Australia","phoneNumber":"0401 455 198","country":"AU","provinceOrState":"VIC","city":"St Kilda","county":"Port Phillip","latLng":[-37.864,144.982],"email":"seahorsevic@gmail.com","socialMedia":{"yelpUrl":null,"googleMapsUrl":null},"title":"Seahorse Victoria Club","description":"설립된 1975년, Seahorse Club Victoria는 transgender 커뮤니티를 위한 자원, 커뮤니티 서비스 및 지원을 제공합니다. 이에는 trans-friendly 서비스 디렉토리 및 회원들이 연결할 수 있는 곧 출시될 온라인 플랫폼이 포함되어 있습니다."},{"id":"df4d32c7-5d7c-4b96-9d3f-60d57d639747","slug":"family-equality","externalUrl":"https://www.familyequality.org/","tags":["legal","education-awareness","parent-family-resources","support-groups"],"address":"475 Park Ave S #2100, New York, NY 10016, USA","phoneNumber":null,"country":"US","provinceOrState":"NY","city":"New York","county":"New York County","latLng":[40.7454596,-73.98217389999999],"email":null,"socialMedia":null,"town":"Manhattan","title":"가족 평등","description":"가족 평등은 LGBTQ+ 가족을 보호하고 지원하는 비영리 조직입니다. 그들은 법적 보호를 위해 싸우고, 자원과 교육을 제공하며, LGBTQ+ 권리를 적극적으로 옹호합니다. 이 조직은 다양한 이벤트를 주최하고 가족들이 서로 및 더 넓은 LGBTQ+ 커뮤니티와 연결될 수 있도록 돕습니다."},{"id":"e20d344a-9e07-44b6-8b9e-c21554a1cda6","slug":"a-complete-guide-to-transmasculine-reproduction","externalUrl":"https://transmasculinereproduction.sites.ucsc.edu/","tags":["transmasculine","healthcare","education-awareness","parent-family-resources","support-groups"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"트랜스마스큘린 재생산에 대한 완전한 가이드","description":"트랜스마스큘린의 생식력, 임신, 출산 후, 수유, 그리고 부모가 되는 것에 대한 정보를 제공하는 종합 가이드입니다. 이 자료에는 트랜스를 긍정적으로 대하는 건강 관리 제공자, 연구된 FAQ, 다양한 리소스 등이 포함되어 있어 트랜스마스큘린 개인들이 부모가 되는 여정에서 교육받고 지원받을 수 있습니다."},{"id":"e51c019c-8dfe-498e-b82e-4263a8f747e8","slug":"equality-florida","externalUrl":"https://www.eqfl.org/","tags":["legal","healthcare","education-awareness"],"address":null,"country":"US","provinceOrState":"FL","city":"St. Petersburg","county":null,"latLng":null,"email":null,"phoneNumber":"813-870-3735","socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/equalityfl/","twitterUrl":"https://twitter.com/EqualityFlorida","instagramUrl":"https://www.instagram.com/equalityfl/","youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Equality Florida","description":"플로리다 최대 LGBTQ 옹호 단체로서 안전하고 건강한 학교, LGBTQ 건강 평등, HIV 옹호, LGBTQ 보호 등을 위해 노력하고 있습니다. 이 단체는 다양한 행사를 개최하며, 트랜스젠더 건강 관리 보조금에 기여하는 등 찬성 평등 지원을 확보하고 있습니다."},{"id":"e5b7c0b6-7106-4426-9809-7d59ebed9ec6","slug":"transhub","externalUrl":"https://www.transhub.org.au/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","health-providers","community-stories","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"NSW","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"TransHub","description":"TransHub는 NSW의 모든 트랜스 및 성 다양성 인구, 그들의 사랑하는 사람들, 동맹자 및 건강 제공자를 위한 디지털 정보 및 자원 플랫폼입니다. 이것은 성장하거나 진정한 자신으로 성장함에 따라 이러한 접근을 할 수 없었던 커뮤니티에게 필요한 정보와 자원에 대한 접근성을 제공합니다. 정보는 호르몬, 수술, 의사 목록과 같은 의료 필요성부터 사회적 및 법적 문제에 이르기까지 다양합니다."},{"id":"e7d26256-017c-4d7e-90d2-30de9386cc03","slug":"twenty10","externalUrl":"https://twenty10.org.au/","tags":["transmasculine","non-binary","transfeminine","social-services","youth-services","support-groups","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"NSW","city":"Sydney","county":null,"latLng":null,"email":null,"socialMedia":{"instagramUrl":"https://www.instagram.com/twenty10glcs/"},"title":"Twenty10","description":"Twenty10은 GLCS를 포함하여 레즈비언, 게이, 양성애자, 트랜스젠더 또는 성 다양성, 성 중성, 퀴어, 무성애자 또는 자신의 신분을 질문하는 뉴사우스웨일스의 젊은이들에게 다양한 삶을 바꾸는 서비스를 제공합니다. 그들의 서비스에는 인테이크 및 참조, 주거 및 사례 관리, 상담, 사회적 지원 프로그램, 그리고 LGBTIQA+ 포괄성 교육이 포함됩니다"},{"id":"eee5057f-7302-4392-b6aa-add70e3e8556","slug":"transgendermap","externalUrl":"https://transgendermap.com","tags":["transfeminine","non-binary","transmasculine","legal","healthcare","mental-health","social-services","community-stories","education-awareness"],"title":"트랜스젠더 맵","description":"Transgendermap.com은 성별 정체성에 대해 질문하거나 트랜스젠더 스펙트럼에 있는 사람들에게 실질적인 정보와 안내를 제공하는 온라인 리소스입니다. 웹사이트에는 트랜스젠더 용어 이해, 전환 과정, 법적 문제, 건강관리, 그리고 수많은 개인적인 이야기와 같은 다양한 주제가 포함되어 있습니다. 이 웹사이트의 목표는 개인의 성별 정체성과 트랜스젠더 경험의 많은 면을 지도나 가이드로 제공함으로써 개개인이 자신의 여정을 이해하는 데 도움을 주는 것입니다. 가장 최신이고 정확한 정보를 위해 실제 사이트를 방문해 주세요."},{"id":"ef7f242d-4d3a-4615-ab35-422dcc90f493","slug":"the-genderaid","externalUrl":"https://genderaid.org/en","tags":["healthcare","education-awareness"],"address":"De Boelelaan 1117, 1081 HV Amsterdam, Netherlands","phoneNumber":null,"country":"NL","provinceOrState":"NH","city":"Amsterdam","county":"Amsterdam","latLng":[52.3346104,4.8598083],"email":"info@genderaid.org","socialMedia":null,"town":"Amsterdam-Zuid","title":"The GenderAid","description":"The GenderAid는 성별 전환 수술을 위한 의사결정 도움을 제공하는 것을 목표로 하며, 치료 옵션에 대한 완벽하고 신뢰할 수 있는 정보를 제공합니다. 이는 WPATH의 가이드라인을 준수하는 네덜란드 건강 관리 시스템에 초점을 맞추고 있으며, non-binary, genderfluid, 그리고 genderqueer 개인을 포함한 모든 트랜스젠더 커뮤니티를 위해 개발되었습니다."},{"id":"f0aa7c03-8837-40f8-82aa-03beb0ac46cc","slug":"transfolk-of-wa","externalUrl":"https://www.transfolkofwa.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","partner-resources","community-stories","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"WA","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"TransFolk of WA","description":"서부 호주의 트랜스젠더 사람들과 그들의 사랑하는 사람들을 위한 동료 지원 서비스입니다. 온라인 그룹, 추천 서비스 및 자원 제공, 다양한 이벤트 주최 등을 제공합니다."},{"id":"f2625d38-e181-4231-8344-214adb6edf36","slug":"transcend-australia","externalUrl":"https://transcend.org.au/","tags":["support-groups","parent-family-resources","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Transcend Australia","description":"Transcend Australia의 목적은 남녀 공유 아동 및 그들의 가족 및 보호자의 삶을 지원하고, 확인하고, 축하하는 것입니다. 그들은 전국의 가족들에게 정보, 지원 및 참조를 제공하고 남녀 공유 아동 및 청소년을 능력있게 만드는 작업을 합니다."},{"id":"f48634db-fe71-426c-be84-622b3282bad7","slug":"planned-parenthood","externalUrl":"https://www.plannedparenthood.org/","tags":["healthcare","mental-health","education-awareness"],"address":null,"phoneNumber":"1-800-230-7526","country":"US","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"플래닌드 페어런트후드","description":"플래닌드 페어런트후드는 성인들의 생식 건강을 중요시하며, 성 교육과 정보를 전 세계 수백만 명에게 제공합니다. 서비스에는 낙태, 피임, 성병 검사 및 치료, 트랜스젠더 호르몬 요법 등이 포함됩니다. 온라인 및 원격 건강 상담이 가능합니다."},{"id":"f596a8bb-1a7d-4b86-a865-c6d6a17984bc","slug":"rfsl-swedish-federation-lgbtq-rights","externalUrl":"https://www.rfsl.se/","tags":["transmasculine","transfeminine","non-binary","legal","healthcare","mental-health","social-services","education-awareness","support-groups"],"address":null,"phoneNumber":null,"country":"SE","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{},"title":"RFSL - 레즈비언, 게이, 양성애자, 트랜스젠더 및 퀴어 권리를 위한 스웨덴 연맹","description":"RFSL은 LGBTQ 권리를 위해 노력하는 스웨덴 조직입니다. 그들은 트랜스젠더 커뮤니티를 위해 중요한 자원, 커뮤니티 지원, 교육 및 인식, 법률 지도, 건강 서비스 등을 제공합니다. RFSL은 국제적인 수준에서 LGBTQ 권리를 촉진합니다."},{"id":"f8b46156-9e3c-4347-aa8a-1df0f89e8f25","slug":"apotheek-all-about-medication","externalUrl":"https://www.apotheek.nl/","tags":["healthcare","education-awareness"],"address":null,"phoneNumber":null,"country":"NL","provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Apotheek.nl - 모든 의약품에 대해","description":"다양한 의약품에 대한 신뢰할 수 있는 정보를 제공하는 자원입니다. 이 사이트에는 동영상, 건강에 대한 현재의 이슈, 백신, 코로나바이러스, 약국 치료에 대한 정보가 포함되어 있습니다. 네덜란드어로 정보를 제공하며, 우크라이나 난민을 위한 50개 주요 의약품을 번역합니다."},{"id":"fc8a7875-84dd-4df5-96ec-8aca153c8ea6","slug":"trans-families-home","externalUrl":"https://transfamilies.org","tags":["transmasculine","non-binary","transfeminine","parent-family-resources","support-groups","education-awareness"],"email":null,"phoneNumber":null,"address":null,"socialMedia":null,"title":"Trans Families","description":"Trans Families는 희망을 불어넣고, 이해를 증진시키며, 트랜스와 성 다양성을 가진 아이들과 그들의 생활에 관련된 모든 사람들을 지원하는 명확한 길을 제시합니다. 우리는 자원을 제공하고, 이벤트를 구성하며, 가족들을 지원 그룹에 연결합니다."}]')}}]);